import React from "react";
import styled from "styled-components";

export default function Last() {
  return (
    <>
      <div>
        <H3>Offers & rewards</H3>
      </div>
    </>
  );
}

const H3 = styled.h3`
  font-size: 20px;
  font-weight: normal;
  margin-bottom: 20px;
`;
